import React from 'react';
import './Prisoner.css';

const Prisoner = props => {
    return (
        <div className="prisoner-container" onClick={this.toggle}>
            <div className="summary-info">
                <h3>{props.name}</h3>
                <p>{props.skills}</p>
                <p>{props.availability}</p>
            </div>

            <div className="full-info visibility">
                <img src={props.picture} />
            </div>
        </div>
    )
};

export default Prisoner;
